import React, { Children } from "react";
import classes from "./Button.module.css";

const Button = (props) => {
  return (
    <div>
      <button type="submit" className={`${classes.button} ${props.className}`}>
        {Children.props}
      </button>
    </div>
  );
};

export default Button;
